import React, { Component } from "react";
import data from "../Data/daily_json.json";

export default class DataFetch extends Component {
  render() {
    const originalData = data;
    let dataArr = [];
    originalData.forEach(element => {
      this.dataArr = element.Price;
    });
    return <div></div>;
  }
}
